import './App.css';
import searchBar from "./components/searchBar/searchBar";
import card from "./components/card/card";
import characters, {Rick}  from "./data";

function App() {
  return (
    <>
    <header>
        <searchBar/>
    </header>

    <div>
        <card
            name={Rick.name}
            species={Rick.species}
            gender={Rick.gender}
            image={Rick.image}/>
    </div>
    </>
  );
}

export default App;
